        <div>
            <Popup trigger=
                {<button> กรอก </button>} 
                modal nested>
                {
                    close => (
                        <div style={boxget}>
                            <div style={divStyle}>
                                กรอกอาหาร
                            </div>
                            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                                <button onClick={() => close()}>
                                    บันทึก
                                </button>
                            </div>
                        </div>
                    )
                }
            </Popup>
        </div>
    )
};
